async function getMenuDays() {
    // this function get valid days for ordering food from server
    let response = await fetch("/order/GetMenuDays/", {
        method: "GET", headers: {
            "X-CSRFToken": document.querySelector("#token").value
        }
    })
    return (await response).json()

}

function SelectBtnMenuColor(btn) {
    let buttons = document.querySelectorAll(".FoodDayBtn")
    buttons.forEach(e => {
        if (e == btn) {
            e.classList.remove("btn-primary")
            e.classList.add("btn-success")
        } else {
            if (e.classList.contains("btn-success")) {
                e.classList.remove("btn-success")
                e.classList.add("btn-primary")
            }
        }
    })
}

function makeMenuDaysButtons(MenuList) {
    // this function take response json that contains days for order from server and make buttons for each day and insert it in html
    const MakeBtn = (DayString, DayDate, classColor) => { // inner function for creating buttons for days
        let btn = document.createElement("button")
        let div = document.createElement("div")
        div.className = "col-lg-3 col-sm-6 col-10"
        btn.innerText = `${DayString.toString()} - ${DayDate.replaceAll("-", "/").toString()}`
        btn.className = classColor + "FoodDayBtn"
        btn.setAttribute('data-day', DayDate.replaceAll("-", "/").toString())
        div.appendChild(btn)
        return div
    }


    // this function create days widget for days
    const DayButtonsContainer = document.querySelector("#FoodMenuButtons")
    DayButtonsContainer.innerHTML = ""

    let FirstItem = null
    MenuList.forEach((each, index) => {
        let FoodDate = each['date-shamsi']
        let FoodDayString = each['date-shamsi-farsi']
        let btn = MakeBtn(DayString = FoodDayString, DayDate = FoodDate, classColor = ` btn btn-primary m-2  w-100 `,)
        DayButtonsContainer.appendChild(btn)

        btn.children[0].addEventListener("click", async (event) => {
            await showMenuFood(event.currentTarget.dataset.day)
            SelectBtnMenuColor(btn.children[0])

        })
        if (index == 0) { // keep tracking of first button for showing items of it
            FirstItem = btn.children[0]
        }
    })
    if (FirstItem) {
        FirstItem.click()
    }
}

async function IsValidDayStringPersian(Day) {
    let formData = new FormData()
    formData.append("day", Day)

    let response = await fetch("/order/GetDayFood/", {
        method: "POST", headers: {
            "X-CSRFToken": document.querySelector("#token").value
        }, body: formData
    })
    let data = await response.json()
    return data
}

async function showMenuFood(Day) { // this function get a day('شنبه') and send it to server for getting that days food and show it to user
    const FoodCardContainer = document.querySelector(".food-container")
    FoodCardContainer.innerHTML = ""


    function MakeFoodCardShow(foodKey, foodName, foodImg, foodCaption, targetDate, is_ordered, InnerButtonText) {
        if (!InnerButtonText) {
            InnerButtonText = "امکان سفارش غذا وجود ندارید."
        }
        Animations = ["fade_center"]
        radnomNumber = Math.floor(Math.random() * Animations.length - 1)
        let temp = `
            <div class="col-lg-3 col-md-6 col-11 my-2 fade_center ">
                <div class="card shadow">
                    <div class="card-body p-0">
                        <img loading="lazy" class="card-img-top img-thumbnail img-fluid" style="height: 450px" 
                        src="${foodImg[0].length < 128 ? `/${getServerPath()}/Foods/` + foodImg[0] : 'data:image/png;base64,'}">
                        <div class="d-flex flex-column justify-content-center align-items-center">
                            <p class="text-center m-2">${foodName}</p>
                            <p class="text-center m-2" dir="rtl"> ${foodCaption}</p>
                        </div>
                    </div>
                    <div class="card-footer">
                        ${!is_ordered ? `<button data-key="${foodKey}" data-target="${targetDate}" class="btn btn-success order-btns"> سفارش </button>` : `<button dir="rtl" class="btn btn-warning w-100"> ${InnerButtonText} </button>`}
                    </div>
                </div>
            </div>
        `
        FoodCardContainer.innerHTML += temp
    }

    response = await IsValidDayStringPersian(Day)

    if (response.status === 'success') {
        // iterate over all foods data
        for (let i = 0; i < response.data.length; i++) {
            let data = response.data[i]
            MakeFoodCardShow(
                foodKey = data['food-key'],
                foodName = data['name'],
                foodImg = data['images'],
                foodCaption = data['caption'],
                targetDay = Day,
                is_ordered = data.is_ordered,
                InnerButtonText = "غذای مورد نظر رزرو شده است")
        }
        if (response.data.length == 0) {
            Swal.fire({
                title: "غذایی تعریف نشده است",
                text: "غذایی برای روز مورد نظر توسط مدیر سامانه تعریف نشده است",
                icon: "warning",
                confirmButtonText: "فهمیدم"
            }),
            MakeFoodCardShow(foodKey = "NULL", foodName = "غذایی برای امروز در سامانه تعریف نشده است", foodImg = ["data:image/png;base64,"], foodCaption = "غذایی برای روز مورد نظر توسط مدیر سامانه تعریف نشده است", targetDay = "NULL", is_ordered = true)
        }
    }

    watchRegisterOrderButtons()

}


function watchRegisterOrderButtons() {
    let buttons = document.querySelectorAll(".order-btns")
    buttons.forEach(each => {
        each.addEventListener("click", async (e) => {
            const ClickedElement = e.currentTarget
            let foodKey = e.currentTarget.dataset.key
            let targetDay = e.currentTarget.dataset.target
            data = await registerOrder(foodKey = foodKey, targetDay = targetDay)

            if (data.status == 'failed') {
                Swal.fire({
                    title: "خطا", text: data["error"], icon: "warning", confirmButtonText: 'فهمیدم',

                }).then(e => {
                    if (e.isConfirmed) {
                        //window.location.reload()
                    }
                })
            } else {
                Swal.fire({
                    title: "عملیات با موفقیت انجام شد",
                    text: data["message"],
                    icon: "success",
                    confirmButtonText: 'فهمیدم',

                }).then(async (e) => {
                    if (e.isConfirmed) {
                        // window.location.reload()
                        ClickedElement.className = "btn btn-warning w-100"
                        ClickedElement.textContent = "غذای مورد نظر رزرو شده است"

                    }
                })
            }
        })
    })
}


async function registerOrder(foodKey, targetDay) { // register users orders
    let formData = new FormData()
    formData.append("day", targetDay)
    formData.append("food", foodKey)

    let response = await fetch("/order/", {
        method: "POSt", headers: {
            "X-CSRFToken": document.querySelector("#token").value
        }, body: formData
    })
    let data = await (response.json())
    return data
}

window.addEventListener("DOMContentLoaded", async (e) => {
    const Days = await getMenuDays()
    makeMenuDaysButtons(Days)
})